import erc20Token from "@/utils/web3/contractABI/erc20Token";
import pools from "@/utils/web3/contractABI/pools";
import swapPair from "@/utils/web3/contractABI/swapPair";

let erc20 = erc20Token.abi
let pool = pools.abi
let swap = swapPair.abi

export default {
  erc20,
  pool,
  swap
}
